@sospartan deprecated is ok. When href is empty string jump to current page logic the same with web. But web support href execute javascript. For example `<a href="javascript:void(0);"></a>`. In this case when click on a component will to do nothing on web. But on iOS/Android will open a new page 'javascript:void(0);'. It would be 404 page. When we want to get the same effect should be to do as below sample:

```
<a v-if="isGotoNewPage" :href="myURL"><text>New page</text></a>
<a v-if="!isGotoNewPage"><text>New page</text></a>

// or
<div @click="myAction()"><text></text></div>

export default {
    methods: {
        myAction() {
            if(isGotoNewPage) weex.requireModule('navigator').push(this.myURL)
        }
    }
}
```

The a component's purpose is reduce js/native interactive times. But this changes it's not enough for real case.
